export const AnimatedThingy: React.FC<{className?: string}> = ({className}) => {
  const shouldReduceMotion = useReducedMotion()
  return (
    <motion.div
      className={cn(
        'grid h-6 w-10 -skew-x-12 scale-105 grid-cols-3 overflow-hidden',
        className,
      )}
    >
      {new Array(3).fill({}).map((_, i) => {
        return (
          <motion.div
            initial={{
              opacity: 0,
            }}
            animate={
              shouldReduceMotion
                ? {}
                : {
                    opacity: [1, 0, 1],
                    y: ['-100%', '100%'],
                  }
            }
            transition={{
              duration: 2,
              repeatDelay: 1,
              delay: i * 0.2,
              repeat: Infinity,
              repeatType: 'mirror',
              type: 'spring',
            }}
            className="h-full w-full bg-gray-800"
          />
        )
      })}
    </motion.div>
  )
}

